import React from 'react';
import TextField from '@material-ui/core/TextField';

class Catalog extends React.Component {
  constructor(props) {
    super(props);

    this.onEnter = this.onEnter.bind(this);
  }

  onEnter(e) {
    console.log(e);
  }

  render() {
    return (
      <div>
        <TextField onKeyUp={this.onEnter} />
      </div>
    );
  }
}

export default Catalog;
